import React from 'react';
import AppStore from '../assets/app-store.png';
import GooglePlay from '../assets/google-play.png';
import Facebook from '../assets/facebook.png';
import Youtube from '../assets/youtube.png';
import Instagram from '../assets/instagramme.png';

const Footer = () => {
    return (
        <footer>
            <ul id="footer-row1">
                <li> <a href=""> Blog Tech | </a> </li>
                <li> <a href=""> General conditions | </a> </li>
                <li> <a href=""> Legal information | </a> </li>
                <li> <a href=""> Data protection | </a> </li>
                <li> <a href=""> Data parameters | </a> </li>
            </ul>

            <ul id="footer-row2">
                <div>
                    <li>
                        <h5> Applications New Style </h5>
                    </li>
                </div>
                <div class="inline_links">
                    <li> <a href=""> <img src={AppStore} width="100px" alt="" /> </a> </li>
                    <li> <a href=""> <img src={GooglePlay} width="100px" alt="" /> </a> </li>
                </div>
            </ul>

            <ul id="footer-row3">
                <div>
                    <li>
                        <h5> More inspiration </h5>
                    </li>
                </div>
                <div class="inline_links">
                    <li> <a href="https://www.facebook.com"> <img src={Facebook} alt="" /> </a> </li>
                    <li> <a href="https://www.youtube.com"> <img src={Youtube} alt="" /> </a> </li>
                    <li> <a href="https://www.instagram.com"> <img src={Instagram} alt="" /> </a> </li>
                </div>
            </ul>
        </footer>
    );
};

export default Footer;
